raw_df.info()
raw_df.head()

"""## Data Preparation: Selecting Key EV Attributes

First, we trim the raw DOE dataset (4,042 rows  75 columns) to the 10 fields essential for our analysis:
- **Station Name** and **City** for identification  
- **Latitude/Longitude** for mapping  
- **Open Date** to build our time series  
- **EV Level1 EVSE Num**, **EV Level2 EVSE Num**, **EV DC Fast Count** for capacity  
- **EV Network** and **EV Connector Types** to understand provider and connector mix  

This gives us a clean DataFrame to feed into our downstream steps.
"""

# Focus on the key EV fields
ev_cols = [
    'Station Name','City','Latitude','Longitude','Open Date',
    'EV Level1 EVSE Num','EV Level2 EVSE Num','EV DC Fast Count',
    'EV Network','EV Connector Types'
]
df = raw_df[ev_cols].copy()
print("Trimmed df shape:", df.shape)
df.head()

#### Full Preprocessing #####

# Start from the raw DataFrame loaded in Cell 2
df = raw_df.copy()

# Keep only Existing stations
df = df[df['Status Code'] == 'E'].copy()

# Drop columns > 90 % missing _except_ these required ones_
connector_cols = ['EV Level1 EVSE Num', 'EV Level2 EVSE Num', 'EV DC Fast Count']
required_cols = connector_cols + [
    'Cards Accepted', 'EV Connector Types', 'Open Date',
    'Status Code', 'EV Workplace Charging', 'Latitude', 'Longitude'
]
threshold = 0.90
mask = (~(df.isnull().mean() > threshold)) | (df.columns.isin(required_cols))
df = df.loc[:, mask].copy()

# Parse 'Open Date' to datetime & drop invalid
df['open_date_dt'] = pd.to_datetime(df['Open Date'], errors='coerce')
df = df.dropna(subset=['open_date_dt']).copy()

# Create 'install_month' (first day of month)
df['install_month'] = df['open_date_dt'].dt.to_period('M').dt.to_timestamp()

# Fill connectorcount fields (NaN0) and cast to int
for c in connector_cols:
    df[c] = df[c].fillna(0).astype(int)

# Encode 'EV Workplace Charging' as 0/1
df['EV Workplace Charging'] = df['EV Workplace Charging'].astype(int)

# Engineer 'card_count' from semicolondelimited 'Cards Accepted'
df['card_count'] = (
    df['Cards Accepted']
      .fillna('')
      .apply(lambda x: len([p for p in x.split(';') if p]))
)

# Engineer 'connector_type_count' from 'EV Connector Types'
df['connector_type_count'] = (
    df['EV Connector Types']
      .fillna('')
      .apply(lambda x: len(set(p.strip() for p in x.split(';') if p)))
)

# Reset index
df.reset_index(drop=True, inplace=True)

# Sanity check
print("After preprocessing, df shape:", df.shape)
df[['install_month'] + connector_cols + ['card_count','connector_type_count']].head()

