"""You can see a nearflat level of installs from 2009 through 2018with almost zero new stations most monthsfollowed by a rapid uptick starting in mid-2019 as policies, incentives, and network investments accelerated Massachusettss build-out of charging sites.

**Trend:** The 12-month rolling average confirms this acceleration: installs climb from an average of fewer than 5 new stations per month in 2018 to a plateau above 50 per month by 2021. That plateau then holds steady around 5070 monthly installs through 2024.

**Seasonal:** There is a pronounced annual pattern: every summer, we see a burst of roughly +30 installs above trend, followed by dips of 10 or so in winter months. This likely reflects construction schedules, permitting cycles, and perhaps increased consumer/utility activity in warmer weather.

**Residual:** Most months deviations from the combined trend and seasonality are within 20 stations, indicating our model captures the core patterns well. However, the massive spike in early 2021 (over 400 installations) shows up as a large positive residualan outlier likely tied to a major network roll-out event or new state funding tranche.

### **Introducing SARIMA for Seasonal Forecasting**

To build on our ARIMA baseline and more accurately reflect the clear annual cycle in station roll-outs, we turned to a Seasonal ARIMA (SARIMA) model. By adding seasonal autoregressive and moving-average components at a 12-month lag, SARIMA directly captures the summer peaks and winter lulls we observe in Massachusetts installs. This lets us produce forecasts that not only follow the long-term growth trend but also respect recurring seasonal swings, giving planners precise month-by-month targets that align with construction schedules, permitting cycles, and incentive programs.
"""

import pandas as pd
import numpy as np
import matplotlib.pyplot as plt
from statsmodels.tsa.statespace.sarimax import SARIMAX
from sklearn.metrics import mean_squared_error, mean_absolute_error
from pandas.tseries.offsets import MonthBegin


# Extract the installs series
monthly_installs = monthly['installs']

# 1. Prepare series & split
series = monthly_installs.copy()
train, test = series[:-12], series[-12:]

# 2. Fit SARIMA(1,1,1)x(1,1,1,12)
model = SARIMAX(
    train,
    order=(1, 1, 1),
    seasonal_order=(1, 1, 1, 12),
    enforce_stationarity=False,
    enforce_invertibility=False
)
res = model.fit(disp=False)

# 3. In-sample metrics
fitted = res.fittedvalues
print("In-sample RMSE:", np.sqrt(mean_squared_error(train, fitted)))
print("In-sample MAE: ", mean_absolute_error(train, fitted))

# 4. Forecast held-out 12 months
fc_test    = res.get_forecast(steps=12)
pred_test  = fc_test.predicted_mean
ci_test    = fc_test.conf_int()
pred_test.index = test.index

print("\nOut-of-sample RMSE:", np.sqrt(mean_squared_error(test, pred_test)))
print("Out-of-sample MAE: ", mean_absolute_error(test, pred_test))

# 5. Forecast next 12 months beyond data
last_month    = series.index.max()
future_index  = pd.date_range(start=last_month + MonthBegin(), periods=12, freq='MS')
fc_all        = res.get_forecast(steps=24)
pred_future   = fc_all.predicted_mean[-12:]
ci_future     = fc_all.conf_int().iloc[-12:]
pred_future.index = future_index
ci_future.index   = future_index

# 6. Plot everything
plt.figure(figsize=(12,6))
plt.plot(series.index, series,            label='Historical',      color='black')
plt.plot(train.index, fitted,             label='Fitted (train)',  color='blue')
plt.plot(test.index, pred_test, 'o-',     label='Forecast (test)',  color='orange')
plt.fill_between(test.index,
                 ci_test.iloc[:,0],
                 ci_test.iloc[:,1],
                 color='orange', alpha=0.3)
plt.plot(future_index, pred_future, 'o-', label='Forecast (future)', color='green')
plt.fill_between(future_index,
                 ci_future.iloc[:,0],
                 ci_future.iloc[:,1],
                 color='green', alpha=0.2)

plt.title('SARIMA Forecast: Monthly EV Station Installs', fontsize=16)
plt.xlabel('Month',                       fontsize=14)
plt.ylabel('New Stations',                fontsize=14)
plt.legend(loc='upper left')
plt.grid(alpha=0.3)
plt.tight_layout()
plt.show()

"""**SARIMA Forecast Results**

To capture the strong annual cycle in station installationssummer peaks and winter lullsI fitted a SARIMA(1,1,1)(1,1,1,12) model on January 2009May 2024 data. It achieved an in-sample RMSE of **40.46** and MAE of **13.66**, meaning its monthly predictions typically missed by 1440 stations. On the hold-out period (June 2024May 2025), the out-of-sample RMSE improved to **25.65** and MAE to **19.46**, demonstrating reliable performance even when modeling seasonality. The forecasts swing between roughly **7595** new stations in summer and **5565** in winter, and the 12-month projection maintains these 30-station seasonal patterns into mid-2026. These precise, season-aware targets enable planners to time staffing, permitting, and grid-upgrade efforts in alignment with real-world cycles.  
"""

import pandas as pd

# Print Forecast Values

# 1. Testset: actual vs. forecast
test_df = pd.DataFrame({
    'actual':   test,
    'forecast': pred_test,
    'lower_CI': ci_test.iloc[:, 0],
    'upper_CI': ci_test.iloc[:, 1],
}, index=test.index)

print("TestSet Forecast vs Actual:")
display(test_df)

# 2. Next 12month projections
future_df = pd.DataFrame({
    'forecast': pred_future,
    'lower_CI': ci_future.iloc[:, 0],
    'upper_CI': ci_future.iloc[:, 1],
}, index=pred_future.index)

print("Next 12Month Forecast:")
display(future_df)

