import numpy as np
import pandas as pd
import matplotlib.pyplot as plt
from statsmodels.tsa.arima.model import ARIMA
from sklearn.metrics import mean_squared_error, mean_absolute_error
from pandas.tseries.offsets import MonthBegin

# 1. Build the monthly install series
monthly = df.groupby('install_month').size().rename('installs')

# 2. Train/test split (last 12 months)
train, test = monthly[:-12], monthly[-12:]

# 3. Fit ARIMA(1,1,1) on train
model = ARIMA(train, order=(1,1,1))
res   = model.fit()

# 4. In-sample metrics
fitted = res.fittedvalues
rmse_in = np.sqrt(mean_squared_error(train, fitted))
mae_in  = mean_absolute_error(train, fitted)
print(f"In-sample   RMSE: {rmse_in:.2f},   MAE: {mae_in:.2f}")

# 5. Forecast test period (12 months)
pred_test = res.forecast(steps=12)
rmse_test = np.sqrt(mean_squared_error(test, pred_test))
mae_test  = mean_absolute_error(test, pred_test)
print(f"Out-of-sample RMSE: {rmse_test:.2f}, MAE: {mae_test:.2f}")

# 6. Create a proper date index for the forecast
last_mon = monthly.index.max()
test_index = pd.date_range(start=last_mon + MonthBegin(), periods=12, freq='MS')

# 7. Future 12-month projection beyond test
pred_future = res.forecast(steps=24)[-12:]
future_index = pd.date_range(start=last_mon + MonthBegin(), periods=24, freq='MS')[-12:]

# 8. Plot historical, fitted, test, and future forecasts
plt.figure(figsize=(12,6))
plt.plot(monthly.index, monthly,        label='Historical', color='black')
plt.plot(train.index, fitted,           label='Fitted (train)', color='blue')
plt.plot(test_index, pred_test.values,  'o-', label='Forecast (test)',  color='orange')
plt.plot(future_index, pred_future.values, 'o-', label='Forecast (future)', color='green')

plt.title('ARIMA(1,1,1) Forecast of Monthly EV Station Installs', fontsize=16)
plt.xlabel('Month', fontsize=14)
plt.ylabel('Number of New Stations', fontsize=14)
plt.legend()
plt.grid(True)
plt.tight_layout()

"""## **ARIMA Baseline Forecast**

I utilized the **ARIMA(1,1,1)** model as our simplest benchmark, training it on 15 years of monthly installation counts to capture the core growth trend and short-term fluctuations.

- **In-sample performance:** On historical data, ARIMAs predictions deviated by about 1140 stations per month (MAE = 11.32; RMSE = 39.47), showing it can follow past patterns reasonably well.
- **Hold-out testing:** When we held out June 2024May 2025, errors tightened to 1724 stations per month (MAE = 17.22; RMSE = 24.10), confirming the models robustness out of sample.
- **Baseline forecast:** Both the test-period forecasts (orange) and the 12-month projection (green) hover around **5560 new stations per month**, reflecting ARIMAs pull toward the recent long-term average.

This consistent, data-driven baseline gives utilities and site operators clear monthly installation targets (55 stations/month). Planners can use these figures for scheduling grid upgrades, allocating crews, and setting budgetary benchmarksbefore layering on seasonality or what-if policy scenarios.

## **Scenario Simulation: +10% EV Registration Surge**

If EV registrations grow by **10%** next year, our baseline of 5560 new charging sites per month would need a **56 station bump** every month. For example:

- **June 2025:** Increase from 57 to 63 new installs  
- **July 2025May 2026:** Add roughly 56 extra stations each month  
- **Total extra:** 6570 additional sites over the year

**Business actions to stay ahead:**
1. **Early permitting:** File applications now to avoid summer permit backlogs  
2. **Crew & hardware planning:** Ramp up staffing and place equipment orders immediately  
3. **Grid readiness in hotspots:** Coordinate with utilities in Boston, Worcester, and Lowell for targeted grid upgrades  

Proactive planning like this ensures we can scale smoothly when demand surges, avoiding delays and maximizing uptime for new stations.
"""

#  Recompute monthly series, ARIMA forecast, +10% Scenario

import pandas as pd
import numpy as np
import matplotlib.pyplot as plt
from statsmodels.tsa.arima.model import ARIMA
from pandas.tseries.offsets import MonthBegin

# 1. Recompute the monthly install counts
#    Assumes df has an 'install_month' datetime column
series = df.groupby('install_month').size().sort_index()
series.index.name = 'Month'
series.name = 'installs'

# 2. Fit ARIMA(1,1,1) on the full series
model = ARIMA(series, order=(1,1,1))
res   = model.fit()

# 3. Forecast next 12 months
last_month   = series.index.max()
future_index = pd.date_range(start=last_month + MonthBegin(), periods=12, freq='MS')
pred_future  = res.forecast(steps=12)
pred_future.index = future_index

# 4. Compute +10% surge scenario
pred_surge = pred_future * 1.10

# 5. Plot baseline vs. surge
plt.figure(figsize=(12,6))
plt.plot(pred_future.index, pred_future, 'o-', label='ARIMA Forecast')
plt.plot(pred_surge.index,  pred_surge,  'o--', label='+10% Surge')
plt.title('Baseline vs. +10% EV Registration Surge Forecast', fontsize=16)
plt.xlabel('Month'); plt.ylabel('New Stations')
plt.legend(); plt.grid(True); plt.tight_layout()
plt.show()

# 6. Tabulate results
scenario_df = pd.DataFrame({
    'baseline':     pred_future,
    'surge (10%)':  pred_surge,
    'incremental':  pred_surge - pred_future
})
print("Scenario Simulation Table:")
display(scenario_df)

