# Network Graph Analysis

import networkx as nx
import numpy as np
from sklearn.neighbors import BallTree
from sklearn.preprocessing import StandardScaler

# 1. Build BallTree on station coordinates (in radians)
coords = np.radians(df[['Latitude', 'Longitude']].values)
tree = BallTree(coords, metric='haversine')

# 2. Find all station-pairs within 5 km (5/6371 radians)
radius = 5 / 6371.0
neighbors = tree.query_radius(coords, r=radius)

# 3. Create an undirected NetworkX graph
G = nx.Graph()
G.add_nodes_from(df.index)  # each node is the stations DataFrame index
for i, inds in enumerate(neighbors):
    for j in inds:
        if i < j:
            G.add_edge(i, j)

# 4. Compute centralities
deg_cent   = nx.degree_centrality(G)
betw_cent  = nx.betweenness_centrality(G)

# 5. Attach scores back to df
df['degree_cent']   = df.index.map(deg_cent)
df['betweenness_cent'] = df.index.map(betw_cent)

# 6. Identify top 10 by each metric
top_hubs = df.nlargest(10, 'degree_cent')[['Station Name','City','degree_cent']]
top_bridges = df.nlargest(10, 'betweenness_cent')[['Station Name','City','betweenness_cent']]

print("Top 10 Hub Stations (Degree Centrality):")
display(top_hubs)

print("\nTop 10 Bridge Stations (Betweenness Centrality):")
display(top_bridges)

