iso = IsolationForest(
    n_estimators=200,
    contamination=0.02,      # top 2% anomalies
    random_state=42
)
df['anomaly_score'] = iso.fit_predict(anom_feats)  # -1 = anomaly, +1 = normal
df['anomaly_dist']  = iso.decision_function(anom_feats)

# 3. Extract the anomaly subset
anomalies = df[df['anomaly_score'] == -1].copy()
anomalies = anomalies.sort_values('anomaly_dist').head(20)  # worst offenders

print("top anomalies:")
display(anomalies[[
    'Station Name', 'City', 'EV Level1 EVSE Num', 'EV Level2 EVSE Num',
    'EV DC Fast Count', 'total_ports', 'degree_cent', 'betweenness_cent',
    'anomaly_dist'
]])

